import React, {Component} from 'react';
import {OwpPageCarded, OwpTabs, OwpToolbar, OwpTreeGrid} from "owp/wrapper";
import FuseHighlight from "owp/@fuse/components/FuseHighlight/FuseHighlight";

class Page extends Component {

    render()
    {
        return (
            <React.Fragment>
                <OwpPageCarded

                    contentToolbar={
                        <OwpToolbar
                            title={"OwpTabs 사용법"}
                        />
                    }

                    content={
                        <React.Fragment>

                                <FuseHighlight component="pre" className="language-js">
                                    {`
                                        <OwpTabs
                                            tabs={[
                                                {label:'IPC Data',content:
                                                    <OwpTreeGrid 
                                                                 id="grid1"
                                                                 LayoutUrl={'/assets/data/owp_302000_01Def.xml'}
                                                                 DataUrl={'./assets/data/owp_302000_01Data.xml'}
                                                    />
                                                },
                                                {label:'LIMS Results',content:
                                                    <OwpTreeGrid 
                                                                 id="grid2"
                                                                 LayoutUrl={'/assets/data/owp_302000_02Def.xml'}
                                                                 DataUrl={'./assets/data/owp_302000_02Data.xml'}
                                                    />
                                                },
                                            ]}
                                        />
                                    `}
                                </FuseHighlight>


                                <OwpToolbar
                                    title={"OwpTabs 예제"}
                                />

                                <OwpTabs

                                    tabs={[
                                        {label:'IPC Data',content:
                                            <OwpTreeGrid
                                                         id="grid1"
                                                         LayoutUrl={'/assets/data/owp_302000_01Def.xml'}
                                                         DataUrl={'./assets/data/owp_302000_01Data.xml'}
                                            />
                                        },
                                        {label:'LIMS Results',content:
                                            <OwpTreeGrid
                                                         id="grid2"
                                                         LayoutUrl={'/assets/data/owp_302000_02Def.xml'}
                                                         DataUrl={'./assets/data/owp_302000_02Data.xml'}
                                            />
                                        },
                                    ]}
                                />
                        </React.Fragment>
                    }innerScroll
                />
            </React.Fragment>
        )
    };
}

export default Page;
